import { LossActionRow } from './LossActionRow';


export function LossActionLevelThree({data, columnProps}){


    if(!data.actionChildItemList) return null
    
    return (
      <>
        <LossActionRow
        columnProps={columnProps}
        data={data}
        padding={35}
        color="green"
      />
      {data.actionChildItemList.map((itemLevelFourth, index) => {
        return (
          <LossActionRow
            columnProps={columnProps}
            data={itemLevelFourth}
            padding={45}
            color="orange"
          />
        )
      })}
    </>
    )
  
}
